import React from "react";
import {Navbar} from "./Navbar";
import '../common/styles/home.css';


export const Home = () => {
  return (
    
    <div className="home">    
      <Navbar/>    
      <img className="img-Background" src="https://images.unsplash.com/photo-1593022356769-11f762e25ed9?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=750&q=80" alt=""></img>

    </div>
      
  );
};
